	"On the Remembering stage of the Spatial CWM you are shown the grid with one filled cell. Remember the cell position on every round.": "ในขั้นตอนการจัดเก็บข้อมูลของ CWM เชิงพื้นที่คุณจะแสดงตารางที่มีเซลล์หนึ่งที่เติมเต็ม จำตำแหน่งของเซลล์ในแต่ละรอบ",
	"On the last stage you have to recall the positions of cells in the order they appeared (by clicking the cells in the grid).": "ในขั้นตอนสุดท้ายคุณต้องจำตำแหน่งของเซลล์ตามลำดับที่ปรากฏ (คลิกเซลล์ในตาราง)",
