	"Game aimed at improving an episodic memory. Episodic memory is the type of memory required when you have to remember where you parked your car in a multi-storey car park after going shopping for several hours or where you left your keys in home several hours ago, for example. It is one of the facets of cognitive functioning." : "เกมนี้มีจุดมุ่งหมายเพื่อปรับปรุงความทรงจำที่เป็นตอน ๆ หน่วยความจำขั้นตอนคือประเภทของหน่วยความจำที่จำเป็นเมื่อคุณต้องจำที่จอดรถของคุณในที่จอดรถหลายชั้นหลังจากไปช้อปปิ้งเป็นเวลาหลายชั่วโมงหรือที่คุณซ้ายคีย์ของคุณในบ้านหลายชั่วโมงที่ผ่านมาเช่น เป็นหนึ่งในแง่มุมของการทำงานด้านความรู้ความเข้าใจ",
	"There are as yet no licensed pharmaceutical treatments to improve cognitive functions for people with schizophrenia. However, there is increasing evidence that computer-assisted training and rehabilitation can help people with schizophrenia overcome some of their symptoms, with better outcomes in daily functioning and their lives." : "ยังไม่มียาที่ได้รับการรับรองเพื่อปรับปรุงการทำงานด้านความรู้ความเข้าใจสำหรับผู้ที่เป็นโรคจิตเภท อย่างไรก็ตามมีหลักฐานที่เพิ่มขึ้นว่าการฝึกอบรมและการฟื้นฟูสมรรถภาพโดยใช้คอมพิวเตอร์ช่วยให้ผู้ป่วยจิตเภทสามารถเอาชนะอาการบางอย่างได้ดีขึ้นโดยมีผลลัพธ์ที่ดีกว่าในการทำงานประจำวันและชีวิตของพวกเขา",
	"Schizophrenia is estimated to cost 13.1 billion per year in total in the UK, so even small improvements in cognitive functions could help patients make the transition to independent living and working and could therefore substantially reduce direct and indirect costs, besides improving the wellbeing and health of patients." : "โรคจิตเภทคาดว่าจะมีค่าใช้จ่ายรวมทั้งสิ้น 13.1 พันล้านปอนด์ต่อปีในสหราชอาณาจักรดังนั้นแม้การปรับปรุงด้านความรู้ความเข้าใจจะช่วยให้ผู้ป่วยเปลี่ยนไปใช้ชีวิตและทำงานได้อย่างเป็นอิสระและอาจลดค่าใช้จ่ายโดยตรงและโดยอ้อมนอกจากจะช่วยเพิ่มคุณภาพชีวิตและสุขภาพของ ผู้ป่วย",
	"Concentration" : "สมาธิ",
