	"The Schulte table is one of the most effective exercises for developing the brain, attention, concentration, speeding up the visual search. Also this exercise is the most popular exercise for the development of speed reading. Schulte tables usually consist of randomly arranged numbers. The number of cells in the tables is also different and most often they are the size of 5x5 elements." : "ตาราง Schulte เป็นหนึ่งในแบบฝึกหัดที่มีประสิทธิภาพมากที่สุดสำหรับการพัฒนาสมองความสนใจสมาธิเร่งค้นหาภาพ นอกจากนี้การออกกำลังกายนี้เป็นแบบฝึกหัดที่นิยมมากที่สุดสำหรับการพัฒนาความเร็วในการอ่าน ตาราง Schulte มักประกอบด้วยตัวเลขที่มีการจัดเรียงแบบสุ่ม จำนวนเซลล์ในตารางมีความแตกต่างกันโดยมากมักเป็นขนาดขององค์ประกอบ 5x5",
