  	"The location of the circles is much better remembered if we mentally draw the figures that they make up. Their location on the screen can be associated with a figure, some geometric figure, an airplane, a human, etc.": "สถานที่ตั้งของแวดวงจะจดจำได้ดีมากขึ้นหากเราวาดรูปที่พวกเขาแต่งขึ้น สถานที่ตั้งของพวกเขาบนหน้าจอสามารถเชื่อมโยงกับรูปทรงรูปทรงเรขาคณิตรูปเครื่องบินมนุษย์ ฯลฯ",
  	"Almost all easily remember up to 5-8 circles. More than 15 circles remember people with a good memory. If your result is 25-30 circles - you have a wonderful, trained memory. According to our data, more than 50 circles are remembered by people who can be called geniuses.": "เกือบทุกคนสามารถจำได้ถึง 5-8 แวดวง ผู้คนที่มีความจำดีจำได้มากกว่า 15 แวดวง ถ้าผลลัพธ์ของคุณคือ 25-30 รอบคุณมีความจำที่ยอดเยี่ยมผ่านการฝึกอบรม ตามข้อมูลของเราวงการมากกว่า 50 คนจะจดจำได้โดยคนที่สามารถเรียกได้ว่าเป็",
  	"Arbitrary attention": "สนใจโดยพลการ",
