  	"On the screen there will appear tablets with numbers, it is necessary to find a plate with the number indicated on the scoreboard above the number plates.": "บนหน้าจอจะปรากฏเป็นแท็บเล็ตที่มีตัวเลขคุณจำเป็นต้องค้นหาจานที่มีหมายเลขที่ระบุไว้ในสกอร์บอร์ดเ",
  	"Menu" : "เมนู",
