  	"Memory Spatial": "หน่วยความจำเชิงพื้นที่",
  "Planning": "การวางแผน",
  "This training develops spatial working memory. It helps to better navigate the world around, remember where in the parking car, how to get to the library, etc.": "การฝึกอบรมนี้พัฒนาหน่วยความจำในการทำงานเชิงพื้นที่ ช่วยให้คุณสามารถท่องโลกรอบ ๆ ได้ดียิ่งขึ้นโปรดจำไว้ว่าในรถยนต์ที่จอดรถวิธีเดินทางไปที่ห้องสมุด ฯลฯ",
  "Remember the order of the ignition of the bulbs and repeat the ignition by clicking on them with the left mouse button.": "จำคำสั่งของการจุดระเบิดของหลอดไฟและทำซ้ำการจุดระเบิดโดยคลิกที่พวกเขาด้วยปุ่มซ้ายของเมาส์",
