  "The game develops working memory, which is used for temporary storage and processing of information.": "ฝึกหน่วยความจำในการทำงานซึ่งใช้ในการเก็บข้อมูลชั่วคราวและประมวลผลข้อมูล",
  "Remember the location of the orange cells. After the table spilling, find the orange cells and click on them with the left mouse button.": "จำตำแหน่งของเซลล์สีส้ม หลังจากที่ตารางหกหาเซลล์สีส้มและคลิกที่พวกเขาด้วยปุ่มซ้ายของเมาส์",
  "Find the unique element and click on it with the left mouse button.": "ค้นหาองค์ประกอบที่เป็นเอกลักษณ์และคลิกด้วยปุ่มเมาส์ด้านซ้าย",
  "The game is aimed at training the speed of reaction and thinking. There is a myth that the reaction rate is the same for all, but it is not. You can easily verify this. It is enough to pass the test to determine the speed of reaction with friends or relatives. You will notice that it is different. Even one person during the day shows a different reaction rate. Another myth says that the reaction rate can not be improved. This is also not so. A lot of research confirms that the reaction is significantly increased due to exercise.": "เกมมีจุดมุ่งหมายเพื่อการฝึกอบรมความเร็วของปฏิกิริยาและความคิด มีตำนานที่อัตราการเกิดปฏิกิริยาเหมือนกันสำหรับทุกคน แต่ก็ไม่เป็นเช่นนั้น คุณสามารถตรวจสอบได้อย่างง่ายดาย ก็เพียงพอที่จะผ่านการทดสอบเพื่อกำหนดความเร็วของปฏิกิริยากับเพื่อนหรือญาติ คุณจะสังเกตเห็นว่ามันแตกต่างกัน แม้แต่คนเดียวในระหว่างวันแสดงอัตราปฏิกิริยาแตกต่างกัน อีกตำนานกล่าวว่าอัตราการเกิดปฏิกิริยาไม่สามารถปรับปรุงได้ นี้ยังไม่เป็นเช่นนั้น การวิจัยจำนวนมากยืนยันว่าปฏิกิริยานี้เพิ่มขึ้นอย่างมากเนื่องจากการออกกำลังกาย",
  "Compare the card you see now with the previous one (ignoring the color). If they match then press the right key. If not match, press the key to the left.": "เปรียบเทียบการ์ดที่คุณเห็นในตอนนี้กับการ์ดก่อนหน้า (ไม่สนใจสี) หากจับคู่แล้วกดปุ่มขวา หากไม่ตรงกันให้กดปุ่มไปทางซ้าย",
  "Compare the card you see now with the one indicated by the green arrow (ignoring the color). If they match then press the right key. If not match, press the key to the left.": "เปรียบเทียบการ์ดที่คุณเห็นในตอนนี้กับการ์ดที่ระบุโดยลูกศรสีเขียว (ไม่สนใจสี) หากจับคู่แล้วกดปุ่มขวา หากไม่ตรงกันให้กดปุ่มไปทางซ้าย",
  "This training increases working memory and fluid intelligence. It is used in neurophysiological studies to stimulate the activity of certain areas of the brain, as well as in psychology to assess and develop working memory, logical thinking, the ability to concentrate and, in general, fluid intelligence.": "การฝึกอบรมนี้เพิ่มหน่วยความจำในการทำงานและความฉลาดทางมือถือ ใช้ในการศึกษาทางสรีรวิทยาเพื่อกระตุ้นการทำงานของสมองบางส่วนเช่นเดียวกับในด้านจิตวิทยาเพื่อประเมินและพัฒนาหน่วยความจำในการทำงานการคิดเชิงตรรกะความสามารถในการสมาธิและโดยทั่วไปปัญญาเคลื่อนที่",
  "Does the text color on the right match the color name on the left?": "ข้อความทางด้านขวาตรงกับชื่อของสีด้านซ้ายหรือไม่?",
