  "Spatial Attention": "ความสนใจเชิงพื้นที่",
  "A simulator for the development of spatial attention, speed of decision-making. Teach you to focus on details and make decisions faster and react to changing situations. Familiar before, it would seem, things, will appear in a new interesting form.": "จำลองสำหรับการพัฒนาความสนใจเชิงพื้นที่ความเร็วในการตัดสินใจ สอนให้คุณเน้นรายละเอียดและตัดสินใจได้เร็วขึ้นและตอบสนองต่อสถานการณ์ที่เปลี่ยนแปลงไป คุ้นเคยกันมาก่อนดูเหมือนว่าสิ่งต่างๆจะปรากฏในรูปแบบใหม่ที่น่าสนใจ",
  "The trainer develops attention and speed of decision-making. Reading an image with a constantly changing color and shape positively affects visual perception, attention and vision. Just a few minutes, a couple of times a day, will bring your eyes into tone and improve your attention to detail. It is recommended to perform a workout before work which requires great care.": "ตัวจำลองช่วยเพิ่มความสนใจและความเร็วในการตัดสินใจ การอ่านภาพที่มีสีและรูปร่างที่เปลี่ยนแปลงไปอย่างต่อเนื่องจะส่งผลต่อการรับรู้ภาพความสนใจและวิสัยทัศน์ เพียงไม่กี่นาทีสองครั้งต่อวันจะทำให้ดวงตาของคุณเป็นโทนเสียงและเพิ่มความใส่ใจในรายละเอียด ขอแนะนำให้ออกกำลังกายก่อนการออกกำลังกายซึ่งต้องได้รับการดูแลเป็นอย่างดี",
  "The trainer develops attention and speed of decision-making. Reading an image with a constantly changing color and shape positively affects visual perception, attention and vision, and an ever-increasing level of complexity increases effectiveness. Just a few minutes, a couple of times a day, will bring your eyes into tone and improve your attention to detail. It is recommended to perform a workout before work which requires great care.": "ตัวจำลองช่วยเพิ่มความสนใจและความเร็วในการตัดสินใจ การอ่านภาพที่มีสีและรูปร่างที่เปลี่ยนแปลงตลอดเวลาส่งผลดีต่อการรับรู้ภาพความสนใจและวิสัยทัศน์และระดับความซับซ้อนเพิ่มมากขึ้นเรื่อย ๆ เพียงไม่กี่นาทีสองครั้งต่อวันจะทำให้ดวงตาของคุณเป็นโทนเสียงและเพิ่มความใส่ใจในรายละเอียด ขอแนะนำให้ออกกำลังกายก่อนการออกกำลังกายซึ่งต้องได้รับการดูแลเป็นอย่างดี",
  "Which number is bigger?": "จำนวนใดที่ใหญ่กว่า?",
  "Left": "ไปทางซ้าย",
